window.bookSummaryJSON = "<p>With my world in shambles, it's hard to tell friend from foe.</p> <p>The joy of finding my fated mate is overshadowed by a dark reality.</p> <p>Someone is hunting wolf shifters. Everyone is in danger unless we can stop those responsible. But we have to find them first.</p> <p>Our only lead is a familiar face. Once a friend. Now an enemy.</p> <p>It makes it impossible to trust anyone. Yet we must look to other supernaturals for assistance since we're outnumbered.</p> <p>With my mate at my side, the fight rages.</p> <p>Until a final revelation changes everything . . .</p>"; 
